import React from 'react';
import './Task02.css';
import PropTypes from 'prop-types';

const Stats = ({ title, stats }) => (
    <h2 className="title">{title}</h2>
);

title.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Stats;
